var linkContracts = function(railway, staffstore, titlestore, coursestore, teststore, suspensionstore, revocationstore, suspensionevidencestore, revocationevidencestore, rolestore) {
    console.log('Linking contracts ');
    railway.setRoleContract(rolestore.address,{from:owner, gas:transGas});
    staffstore.setRoleContract(rolestore.address,{from:owner, gas:transGas});
    titlestore.setRoleContract(rolestore.address,{from:owner, gas:transGas});
    coursestore.setRoleContract(rolestore.address,{from:owner, gas:transGas});
    teststore.setRoleContract(rolestore.address,{from:owner, gas:transGas});
    suspensionstore.setRoleContract(rolestore.address,{from:owner, gas:transGas});
    revocationstore.setRoleContract(rolestore.address,{from:owner, gas:transGas});
    suspensionevidencestore.setRoleContract(rolestore.address,{from:owner, gas:transGas});
    revocationevidencestore.setRoleContract(rolestore.address,{from:owner, gas:transGas});
    console.log('RoleStore in RailwaySecurity and stores done.');
    railway.setStaffContract(staffstore.address, {from:owner, gas:transGas});
    railway.setTitleContract(titlestore.address, {from:owner, gas:transGas});
    railway.setCourseContract(coursestore.address, {from:owner, gas:transGas});
    railway.setTestContract(teststore.address, {from:owner, gas:transGas});
    railway.setSuspensionContract(suspensionstore.address, {from:owner, gas:transGas});    
    railway.setRevocationContract(revocationstore.address, {from:owner, gas:transGas}); 
    railway.setSuspensionEvidenceContract(suspensionevidencestore.address,{from:owner, gas:transGas});
    railway.setRevocationEvidenceContract(revocationevidencestore.address,{from:owner, gas:transGas});
    console.log('stores in RailwaySecurity contract done.');
    titlestore.setContractStore(railway.address, {from:owner, gas:transGas});
    coursestore.setContractStore(railway.address, {from:owner, gas:transGas});    
    teststore.setContractStore(railway.address, {from:owner, gas:transGas});
    suspensionstore.setContractStore(railway.address, {from:owner, gas:transGas});  
    revocationstore.setContractStore(railway.address, {from:owner, gas:transGas});  
    suspensionevidencestore.setContractStore(railway.address, {from:owner, gas:transGas});
    revocationevidencestore.setContractStore(railway.address, {from:owner, gas:transGas});
    console.log('RailwaySecurity in stores done.');

	railwayAddress = railway.address;
	staffstoreAddress = staffstore.address;
    titlestoreAddress = titlestore.address;
	coursestoreAddress = coursestore.address;
    teststoreAddress = teststore.address;
    suspensionstoreAddress = suspensionstore.address;  
    revocationstoreAddress = revocationstore.address;   
    suspensionevidencestoreAddress = suspensionevidencestore.address;
    revocationevidencestoreAddress = revocationevidencestore.address;
    rolestoreAddress = rolestore.address;

    // Print Info
    info();

    // console.log("----------------------- OWNERS -----------------------");
    // console.log('railway: ' + railway.owner());
    // console.log('staffstore: ' + staffstore.owner());
	// console.log('titlestore: ' + titlestore.owner());
    // console.log('coursestore: ' + coursestore.owner());
    // console.log('teststore: ' + teststore.owner());
    // console.log('suspensionstore: ' + suspensionstore.owner());    
    // console.log('revocationstore: ' + revocationstore.owner());  
};

var deploy = function() {
	console.log('Calling contract creation');
	deployRailwaySecurity(owner, function(railway) {
	    console.log('RailwaySecurity ready, calling StaffStore');
	    deployStaffStore(owner, function(staffstore) {
            console.log('StaffStore ready, calling TitleStore');
            deployTitleStore(owner, function(titlestore) {
    	        console.log('TitleStore ready, calling CourseStore');
    	        deployCourseStore(owner, function(coursestore) {
    	            console.log('CourseStore ready, calling TestStore');
                    deployTestStore(owner, function(teststore) {
                        console.log('TestStore ready, calling SuspensionStore');
                        deploySuspensionStore(owner, function(suspensionstore) {
                            console.log('SuspensionStore ready, calling RevocationStore');
                            deployRevocationStore(owner, function(revocationstore) {
                                console.log('RevocationStore ready, calling SuspensionEvidenceStore');                            
                                deploySuspensionEvidenceStore(owner, function(suspensionevidencestore) {
                                    console.log('SuspensionEvidenceStore ready, calling RevocationEvidenceStore');
                                    deployRevocationEvidenceStore(owner, function(revocationevidencestore) {
                                        console.log('RevocationEvidenceStore ready, calling RoleStore');
                                        deployRoleStore(owner, function(rolestore) {
                                            console.log('RoleStore ready, calling final config');
                                            linkContracts(railway, staffstore, titlestore, coursestore, teststore, suspensionstore, revocationstore, suspensionevidencestore, revocationevidencestore, rolestore);
                                        });
                                    });
                                });    
                            });
                        });                                    
                    });
    	        });
            });
	    });
	});
};

