    coursestore.setPromotion(CourseAction.Offer,   CourseStatus.Requested,  Actor.RS | Actor.CF,            CourseStatus.Offered,     CourseStatus.Offered,     TitleAction.None, {from:owner});
    coursestore.setPromotion(CourseAction.Confirm, CourseStatus.Offered,    Actor.RS,                       CourseStatus.Approved,    CourseStatus.Approved,    TitleAction.None, {from:owner});
    coursestore.setPromotion(CourseAction.Reject,  CourseStatus.Offered,    Actor.RS,                       CourseStatus.NotApproved, CourseStatus.NotApproved, TitleAction.None, {from:owner});
    coursestore.setPromotion(CourseAction.Start,   CourseStatus.Approved,   Actor.RS | Actor.RO | Actor.RF, CourseStatus.InProgress,  CourseStatus.InProgress,  TitleAction.None, {from:owner});
    coursestore.setPromotion(CourseAction.Pass,    CourseStatus.InProgress, Actor.RS | Actor.CF,            CourseStatus.Passed,      CourseStatus.Passed,      TitleAction.None, {from:owner});
    coursestore.setPromotion(CourseAction.Fail,    CourseStatus.InProgress, Actor.RS | Actor.CF,            CourseStatus.Failed,      CourseStatus.Failed,      TitleAction.None, {from:owner});
